import React from 'react';
import Sidebar from './Sidebar';
import Job from './Job';

const Manager = () => {
    return (
        <div style={{ minHeight: '100vh' }}>
            <div className='container-fluid' style={{ marginTop: '62px', minHeight: '100vh' }}>
                <div className='row' style={{ height: '100%' }}>
                    <div className='col-2 d-flex flex-column' style={{ height: '100vh' }}>
                        <Sidebar />
                    </div>
                    <div className='col' style={{ border: '1px solid red', height: '100vh' }}>
                        <Job/>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Manager;
